INSERT INTO `nodarb_tips` VALUES (1,'Advance Fit','advance-fit','ADVANCE FIT. Augstas intensitātes kardio treniņš ķermeņa spēka, veiklības un izturības palielināšanai. Šis intervāltreniņš kombinējas no aerobikas kustībām ar spēka un balansa vingrojumiem. Dinamiska mūzika un instruktors motivēs ikvienu sasniegt sportiskos mērķus.',1),(2,'B&L BOSU','bl-bosu','B&L BOSU. Nodarbība dziļās muskulatūras stiprināšanai, izmantojot BOSU platformu, kas savukārt nodarbina un trenē vestibulāro aparātu.',1),(3,'BodyPump','bodypump','BODY PUMP. 55 minūšu spēka nodarbība, kurā izmanto svaru stieni ar maināmiem svariem un stepa platformu. Nodarbība piemērota visiem sagatavotības līmeņiem, gan sievietēm, gan vīriešiem. BodyPump ir lielisks veids, kā uzlabot spēka izturību, veidot proporcionālu muskuļu reljefu, dedzināt liekās kalorijas, kā arī uzlabot garastāvokli.',1),(4,'Body Condition','body-condition','BODY CONDITION. Aerobikas nodarbība, kura vērsta uz ķermeņa muskulatūras attīstīšanu un nostiprināšanu ar speciāliem vingrinājumiem problēmu zonām ar un bez palīglīdzekļiem. \r\nĪpaša uzmanība pievērsta ķermeņa problēmzonām.\r\nNodarbība piemērota visiem sagatavotības līmeņiem.',1),(5,'Brasilian Butt','brasilian-butt','BRASILIAN BUTT. Fitnesa nodarbība  tiek vērsta uz augšstilbu, sēžas, vēdera preses un muguras muskulatūras  nostiprināšanu un attīstīšanu. Nodarbības pirmajā daļā ar speciāliem vingrinājumiem tiek nostiprināta  un attīstīti sēžas un augšstilba muskulatūra, nodarbības otrā daļā vēdera prese un muguras muskulatūra.',1),(6,'Combat','combat','COMBAT. Nodarbība ir izaicinošs un spēcīgs kardio treniņš, kurā Tu sajutīsies kā norāvies no ķēdes. Šī nevaldāmā un enerģiskā grupas nodarbība ir iedvesmojusies no cīņu mākslām unietver sevī dažādu cīņas stilu apvienojumu: karatē, bokss, teikvondo, tai čī, muay thai u.c. Dinamiskas mūzikas un aizraujoša trenera vadībā Tu spersi, sitīsi un dauzīsi, dedzinot kalorijas un uzlabojot savu izturību.',1),(7,'Core Flow','core-flow','CORE FLOW. Nodarbība piemērota ikvienam. Speciāli vingrinājumi muguras muskulatūras nostiprināšanai un attīstīšanai. Nodarbības nobeiguma daļā tiek izstieptas lielās muskuļu grupas. Tiek pielietots dažāds inventārs. Īpaši piemērota cilvēkiem ar sēdošu darbu.',1),(8,'Kickboxing','kickboxing','KICKBOXING. Intensīva un interesanta nodarbība, kuras laikā Tu iegūsi gan labu fizisko formu, gan apgūsi sitienu tehnikas ar rokām un kājām. Šajā nodarbībā varēsi izlādēt negatīvās emocijas un iegūt spridzinošu enerģiju visai dienai. Šī nodarbība kombinē individuālās tehnikas apgūšanu ar pāru sparingu - divcīņu vienam pret otru. Fonā skan enerģiska mūzika, Tevi uzmundrina pieredzējis instruktors, un tu sper un dauzi, un sit, un gūsti no tā gandarījumu. Ja vēlies - K1 nodarbība var būt arī lieliska cīņa pret kalorijām. Nav svarīgs Tavs dzimums, vecums vai sagatavotības līmenis. Nāc, kāds esi, lai kļūtu par tādu, kāds vēlies būt!',1),(9,'Fat Burner','fat-burner','FAT BURNER. Nodarbība, kuras laikā tiek uzturēta ilgstoša un vienmērīga fiziskā slodze. Vērsta uz ķermeņa masas samazināšanu, vispārēju organisma stiprināšanu un locītavu elastīguma trenēšanu. Labs veids, kā atvadīties no liekiem kilogramiem. \r\nNodarbība piemērota dažādiem fiziskās sagatavotības līmeņiem.\r\nFAT BURNER 2 - nodarbības otrā daļā vingrojumi tiek vērsti uz problēmzonām, saglabājot vienmērīgu intensitāti.',1),(10,'Dance Aerobics','dance-aerobics','DANCE AEROBICS. Vidējas intensitātes aerobās slodzes nodarbība ar deju elementiem, dinamisks sirds-asinsvadu un elpošanas sistēmu treniņš ar horeogrāfiju. Horeogrāfisko nodarbības daļu noslēdz spēka vingrinājumi ķermeņa problēmzonām.',1),(11,'Fat Burner ABL','fat-burner-abl','FAT BURNER ABL. Nodarbība, kuras laikā tiek uzturēta ilgstoša un vienmērīga fiziskā slodze. Vērsta uz ķermeņa masas samazināšanu, vispārēju organisma stiprināšanu un locītavu elastīguma trenēšanu. Kā arī sēžas, kāju un ķermeņa korsetes muskuļu stiprināšanai un attīstībai.',1),(12,'Fitness Yoga','fitness-yoga','FITNESS YOGA. Robeža starp jogu un fitnesu. Nodarbības laikā apgūst jogas pamatkustības un pozas (asanas), kas attīsta lokanību un spēku, kā arī iemāca atslābināties. Palielinās imunitāte, papildinās enerģijas krājumi. Koncentrējot uzmanību elpošanai, muguras stāvoklim un ķermeņa kustībām, Jūs sākat pilnībā kontrolēt savu ķermeni un tā darbību.',1),(13,'Funkcionālais Treniņš','funkcionalais-trenins','FUNKCIONĀLAIS TRENIŅŠ. Nodarbība, kas liek skatīties uz fitnesu plašāk. Nodarbības nosaukums izsaka galveno ideju – tādu ķermeņa muskulāro funkciju attīstīšanu, kas ir nepieciešama ikdienā. Pielietotie vingrojumi palīdz sagatavot ķermeni kustībām, ar kurām saskaramies ikdienas dzīvē, t.sk. bieži arī negaidītām . Treniņš ietver dažādu slodzi – spēkam un izturībai, veiklībai un lokanībai, ka arī sirds-asinsvadu sistēmas uzlabošanai. Darbs gan ar paša ķermeņa svaru, gan ar papildus inventāru.',1),(14,'HIIT','hiit','HIIT. Augstas intensitātes intervāla treniņš. Tiek attīstīta izturība un pārējās cilvēka fiziskās īpašības. Nodarbībā tiek izmantots savs ķermeņa svars, stepa platformas, svaru stieņi un ripas. Vingrotājiem ar iepriekšēju fizisko sagatavotību.',1),(15,'Kalanētika','kalanetika','KALANĒTIKA. Ārstnieciska un atveseļojoša vingrošana, kas nodrošina ķermeņa dziļās muskulatūras stiprināšanu, īpaši noslogojot iegurņa muskulatūru. Kalanētika uzlabo veselību, sekmē kustību aparāta veselības saglabāšanu un spēj profilaktiski novērst muguras sāpes, attīsta gribasspēku, rada prieku un, nodarbojoties regulāri, dod arī pozitīvu efektu - stingru vēderu, slaidas kājas, vingrus gurnus, kā arī stiprinātus dziļos muskuļus un pareizu stāju. Derēs arī tiem, kam nepatīk aerobika un lēkāšana sporta zālē straujos ritmos, vai kuri veselības stāvokļa dēļ nevar kustēties ātras mūzikas pavadījumā.',1),(16,'NTC','ntc','NTC. Nike Training Club ir izstrādājuši profesionāli Nike treneri, lai maksimāli Tevi motivētu un fokusētu vislabākā rezultāta sasniegšanai. 85 vingrojumi palīdz Tev tiekties kļūt stipram un koordinētam. Tie trenē balansu, stabilitāti, piešķir ķermenim kustību brīvību jebkurās citās aktivitātēs; nostiprina ķermeņa augšdaļu, muguru, vēdera muskuļus. Vingrojumi ir funkcionāli gan profesionāliem sportistiem, gan tiem, kuri vēlas nostiprināt muskulatūru.',1),(17,'Pilates','pilates','PILATES. Atzītas nodarbības pasaules fizioterapeitu, ortopēdu un sporta ārstu aprindās. Regulāri nodarbojoties tiek nostiprinātas ne tikai lielās, bet arī dziļās muskuļu grupas. Galvenais akcents tiek likts uz muguras un vēdera muskulatūras nostiprināšanu (korsetes daļu). Pilates – skaista ķermeņa izkopšanas metode. Nodarbība piemērota ikvienam, neatkarīgi no fiziskās sagatavotības pakāpes, un ieteicama cilvēkiem ar veselības problēmām.',1),(18,'Power Pilates','power-pilates','POWER PILATES. Vēl vairāk ķermeņa kontroles, spēka un uzmanības pareizai vingrinājumu izpildei. Tiek izmantots inventārs.',0),(19,'Power&Cardio','powercardio','POWER & CARDIO. Aerobās slodzes un spēka izturības attīstoša un muskuļu reljefa veidojoša fitnesa nodarbība. Intervāla slodze, kur aerobā slodze mijas ar spēka vingrinājumiem. Nobeiguma daļā vēdera preses un muguras muskulatūras attīstoši vingrinājumi.',1),(20,'Power&Mind','powermind','POWER & MIND. Nodarbība vērsta uz muskulatūras attīstīšanu un nostiprināšanu. Spēka vingrinājumi apvienoti ar pilates un jogas elementiem. Viena kustība plūstoši pāriet no otrā. Nodarbība attīsta koordināciju, līdzsvaru, spēku un lokanību. \r\nNodarbība piemērota dažādiem sagatavotības līmeņiem.',0),(21,'Step','step','STEP. Vidējas intensitātes aerobikas nodarbība, izmantojot Step platformas. Klasiskās aerobikas kustības tiek veiktas uz īpašām stepa platformām. Nodarbības beigās vēdera presi stiprinoši un stiepšanās vingrinājumi.',1),(22,'Stretch','stretch','STRETCH. Zemas intensitātes nodarbība, kurā iekļauta vingrojumu sistēma, kas maksimāli atslābina muskuļus un izstiepj tos pēc intensīvas fiziskas noslodzes. Vingrojumi paredzēti lokanības veidošanai un  atjaunošanai. Savienojot tos ar dziļu un vienmērīgu elpošanu nodarbības laikā tiek panākta maksimāla ķermeņa atslābināšanās, kas ļauj atjaunoties muskuļiem, uzlabojot asinsriti un uzturvielu piegādi muskuļiem un visiem ķermeņa orgāniem.',0),(23,'Synrgy360','synrgy360','SYNRGY360. Sistēmas koncepts un izmantojamais inventārs ļauj īstenot gan grupu nodarbības, gan personāltreniņu, kā arī veikt simtiem dažādu vingrinājumu. Vienotā sistēmā integrētas jaunas funkcionālā treniņa metodes, piekares un pretestības treniņš, dinamiski un statiski vingrinājumi, ātruma un eksplozivitātes, dziļo un lielo muskuļu grupu treniņš, izaicinoši rotaļu elementi un daudz kas cits, tādējādi padarot treniņu daudzveidīgu un funkcionālu. Turklāt ļauj ietaupīt arī vietu un laiku. Tas ir inovatīvs un lielisks veids, kā dažādot ierasto un varbūt jau nedaudz apnikušo treniņu rutīnu un uzlabot funkcionālo un vispārējo spēku, koordināciju, ātrumu un veiklību.',1),(24,'Tabata','tabata','TABATA. Augstas intensitātes intervāla treniņš, kurš sastāv no 8 cikliem - 20 sec. darbs, 10 sec. atpūta. Iekļauta gan kardio, gan spēka vingrinājumi.',0),(25,'Total Butt','total-butt','TOTAL BUTT. Treniņš sēžas muskuļu un kāju aizmugurējo daļu (hamstringu) nostiprināšanai un formu veidošanai. Nodarbībā tiek izmantots dažāds inventārs un vingrojumi ir doti uz laiku, kas dod iespēju piedalīties nodarbībā cilvēkiem ar dažādu sagatavotību. Pēdējo gadu laikā visā pasaulē ļoti lielu popularitāti sieviešu vidū ir ieguvuši vingrojumi sēžas muskuļiem, kas padara formīgāku un spēcīgāku sēžamvietu.',1),(26,'Total Press','total-press','TOTAL PRESS. Stipra mugura un trenēta vēderprese ir gan labas stājas, gan veselas muguras, un arī spēcīga ķermeņa pamats. Total Press - nodarbība vēdera un muguras muskuļu stiprināšanai, kurā dinamiski vingrinājumi mijas ar statisku slodzi. Tiek nodarbināti gan ārējie, gan dziļie muskuļi. Tikai 45 minūtes pirms vai pēc sava ikdienas treniņa un Tava mugura būs Tev pateicīga!',1),(27,'Total Butt&Press','total-buttpress','TOTAL BUTT & PRESS. Nodarbība ar mērķi attīstīt atsevišķas muskuļu grupas - sēžas muskuļus un vēdera preses muskuļus. Nodarbības pirmajā pusē tiek izpildīti vingrinājumi sēžas muskuļiem, otrajā daļā - preses muskuļiem. Vingrinājumi tiek izpildīti izmantojot dažādu inventāru, ar laika kontroli, vairākos piegājienos.',1),(28,'TRX','trx','TRX. Suspension Training jeb t.s. piekares treniņu sistēma ir nodēvēta par revolūciju fitnesā. Šīs treniņsistēmas galvenā priekšrocība ir mobilitāte – tās pielietošanai nav nepieciešama stacionāra vide. Pielāgot treniņam var praktiski jebkuru vietu. Sistēma ir vienkārši lietojama, ar pielāgojamu siksnu garumu, kas dod iespēju veikt simtiem dažādu vingrinājumu. Treniņsistēma attīsta spēku, izturību, stabilitāti, lokanību un dziļo muskulatūru. Treniņa laikā kā \"apsmagojums\" tiek izmantots sava ķermeņa svars. Veicot pat ļoti vienkāršus vingrinājumus, ir jānotur ķermeņa poza un stabilitāte, kas savukārt liek darboties dziļajai muskulatūrai, tādēļ treniņš ir īpaši efektīvs.',1),(29,'Velo','velo','VELO. Lielisks veids kā nodrošināt aerobo slodzi, bez lieka noslogojuma balsta un kustību aparātam. Tādēļ Velo nodarbības ir ļoti piemērotas cilvēkiem, kam nav ieteicama skriešana vai lēkāšana. Nodarbības laikā tiek strādāts gan vidējā, gan augstā intensitātē. Velo nodarbības ir piemērotas arī iesācējiem, jo braukšanas tempu vai pretestību vienmēr var pielāgot savām iespējām. Vienas nodarbības laikā tiek sadedzinātas vidēji 500 – 800 kcal, tiek attīstīta sirds un asinsvadu sistēmas izturība, kā arī nostiprināta vēdera, muguras un kāju muskulatūra. Nodarbībā tiek mainīta braukšanas pretestība, imitējot dažādus apvidus, un temps, lai mainītu nodarbības intensitāti.',1),(30,'Velo HIIT','velo-hiit','VELO HIIT. 40 minūšu, augstas intensitātes intervāltreniņš (HIIT) izmantojot, velo trenažierus. Nodarbības garums nodrošina to, ka katrs dalībnieks nodarbības laikā strādāt ar 100% atdevi – gan fiziski, gan garīgi. Mīšanās uz velo trenažiera, izmantojot lielas pretestības, dažādus laika intervālus, kam seko atpūtas pauzes, kas ļauj sagatavoties nākamajam darba cēlienam. Treniņa pluss ir paaugstinātais sirdsdarbības līmenis arī pēc nodarbības beigām, kas nodrošina lielāku kaloriju patēriņu visas dienas laikā. Vingrotājiem ar iepriekšēju fizisko sagatavotību, bet katrs var izvēlēties pretestību, ar kādu strādāt, lai nodrošinātu tieši sev piemērotu slodzi nodarbības laikā.',1),(31,'Veselības Vingrošana','veselibas-vingrosana','VESELĪBAS VINGROŠANA. Zemas intensitātes treniņš, kas ideāli piemērots cilvēkiem bez iepriekšējas fiziskas sagatavotības, tiem, kas vēlas atsākt fiziskas aktivitātes pēc traumām, kā arī cilvēkiem ar nespecifiskām muguras sāpēm. Nodarbība vērsta uz muguras, vēdera preses, iegurņa un ķermeņa dziļās muskulatūras nostiprināšanu. Treniņš sevī ietver spēka, stiepšanās un līdzsvara vingrojumus. Nodarbībās tiek izmantotas hanteles un bumbas, kā arī paša cilvēka ķermeņa svars. Treniņi notiek mazās grupās (līdz 8 cilvēkiem), kas nodrošina pietiekošu uzmanību katram klientam, līdz ar to - kvalitatīvu vingrojumu izpildi. Šīs nodarbības ir arī labs sākums pirms aktīvāku un dinamiskāku treniņu uzsākšanas',1),(32,'ABL','abl','ABL. Nodarbība sēžas, kāju un ķermeņa korsetes muskuļu stiprināšanai un attīstībai. Tiek izmantots dažāds inventārs - stepa platformas, svara manžetes, pildbumbas u.c.',0);
